// JoinedStudent.js
import React, { useEffect, useState } from "react";
import NavbarEmployer from "../Employer/NavbarEmployer";

const JoinedStudent = () => {
  const [joins, setJoins] = useState([]);

  useEffect(() => {
    const fetchJoins = async () => {
      try {
        const response = await fetch("http://localhost:5000/tutor/joins", {
          headers: {
            "Content-Type": "application/json",
            Authorization: `Bearer ${localStorage.getItem("access_token")}`,
          },
        });
        if (response.ok) {
          const data = await response.json();
          setJoins(data);
        } else {
          console.error("Failed to fetch joins");
        }
      } catch (error) {
        console.error("Error:", error);
      }
    };

    fetchJoins();
  }, []);

  return (
    <div>
      <NavbarEmployer />
      <h1>Joins</h1>
      <ul>
        {joins.map((join) => (
          <li key={join.join_id}>
            <p>Name: {join.student_name}</p>
            <p>Email: {join.student_email}</p>
            <p>Job Title: {join.job_title}</p>
            <a href={`http://localhost:5000/uploads/${applicant.resume.split("/").pop()}`} target="_blank" rel="noopener noreferrer">
              View Resume
            </a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default JoinedStudent;
